package model.bean;

public class ThreadAutoCompleteItem {
	String value;
	String data;

	public ThreadAutoCompleteItem() {
		super();
		// TODO Auto-generated constructor stub
	}

	public ThreadAutoCompleteItem(String value, String data) {
		super();
		this.value = value;
		this.data = data;
	}

	public String getValue() {
		return value;
	}

	public void setValue(String value) {
		this.value = value;
	}

	public String getData() {
		return data;
	}

	public void setData(String data) {
		this.data = data;
	}

}
